import Indonesia from "../components/Indonesia/Pasiens";
import Provinces from "../components/Provinces/Pasiens";

const Indonesian = () => {
  return (
    <div>
      <Indonesia />

      <div style={{ height: "60vh" }}>
        <div style={{ textAlign: "center", margin: "80px 0px" }}>
          <h1>Situation by Provinces</h1>
          <p>Data Covid Berdasarkan Provinsi</p>
        </div>
        <Provinces pasiens={[]} />
      </div>
    </div>
  );
};

export default Indonesian;
